import React, { useEffect, useState } from "react";
import axios from 'axios';

function Message() {

    const [result, setResult] = useState(null);

    const chart = async () => {
        try {
            let res = await axios.get('http://127.0.0.1:8000');
            let result = res.data;
            setResult(result)
        } catch (e) {
            console.log(e);
        }
    };

    useEffect(() => {
        chart()
    }, [])

    return (

        <div>
            <h1>Message</h1>
            <div>
                {result}
            </div>
        </div>



    );
}

export default Message
